import './App.css';
import Navbar from "./components/Navbar";
import HomeSection from "./components/HomeSection";
import ServicesSection from "./components/ServicesSection";
import SupportSection from "./components/SupportSection";

function App() {
  return (
    <div className="App">
      <Navbar />
      <HomeSection />
      <ServicesSection />
      <SupportSection />
    </div>
  );
}
export default App;
